import React from "react";

const Types = () => {
  const array2 = [
    {
      name: "Hotels",
      count: 233,
      image: "./images/type_1.webp",
    },
    {
      name: "Apartments",
      count: 2331,
      image: "./images/type_2.jpg",
    },
    {
      name: "Resorts",
      count: 2331,
      image: "./images/type_3.jpg",
    },
    {
      name: "Villas",
      count: 2331,
      image: "./images/type_4.jpg",
    },
    {
      name: "Cabins",
      count: 2331,
      image: "./images/type_5.jpg",
    },
  ];

  return (
    <div>
      <h3>Browse by property type</h3>
      <div>
        {array2.map((array2, index) => (
          <div>
            <img src={array2.image} className={array2.index} />
            <h1>{array2.name}</h1>
            <h3>{array2.count}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};
export default Types;
